def preprocess(image_path):
    img = ii.load_img(image_path, target_size=(299, 299))
    x = ii.img_to_array(img)
    x = np.expand_dims(x, axis=0)
    x = preprocess_input(x)
    return x

def encode(image):
    global graph
    with graph.as_default():
        image = preprocess(image)
        fea_vec = inception_model.predict(image)
        fea_vec = np.reshape(fea_vec, fea_vec.shape[1]) # reshape from (1, 2048) to (2048, )
        return fea_vec

def greedySearch(photo, preprocess_flag):
    global graph
    with graph.as_default():
        acc= []
        in_text = 'startseq'
        for i in range(max_length):
            sequence = [wordtoix[w] for w in in_text.split() if w in wordtoix]
            sequence = pad_sequences([sequence], maxlen=max_length)
            yhat = caption_model.predict([photo,sequence], verbose=0)
            acc.append(yhat[0][np.argmax(yhat[0])])
            yhat = np.argmax(yhat)
            
            word = ixtoword[yhat]
            in_text += ' ' + word
            if word == 'endseq':
                break
        final = in_text.split()
        final = final[1:-1]
        final = ' '.join(final)
        return final, acc

def beam_search_predictions(image_file, preprocess_flag, beam_index):
    global graph
    with graph.as_default():
        start = [wordtoix["startseq"]]
        acc = []
        start_word = [[start, 0.0]]
        while len(start_word[0][0]) < max_length:
            temp = []
            for s in start_word:
                now_caps = pad_sequences([s[0]], maxlen=max_length, padding='post')

                preds = caption_model.predict([np.array([image_file]), np.array(now_caps)])
                
                word_preds = np.argsort(preds[0])[-beam_index:]
                acc.append(preds[0][np.argmax(preds[0])])

                # Getting the top Beam index = 3  predictions and creating a new list to put them back through the model
                for w in word_preds:
                    next_cap, prob = s[0][:], s[1]
                    next_cap.append(w)
                    prob += preds[0][w]
                    temp.append([next_cap, prob])
                        
            start_word = temp
            # Sort by probability
            start_word = sorted(start_word, reverse=False, key=lambda l: l[1])
            # Get top words
            start_word = start_word[-beam_index:]
        
        start_word = start_word[-1][0]
        intermediate_caption = [wordtoix[i] for i in start_word]

        final_caption = []
        
        for i in intermediate_caption:
            if i != '<end>':
                final_caption.append(i)
            else:
                break
        
        final_caption = ' '.join(final_caption[1:])
        return final_caption, acc

def predict_caption(img_path, preprocess_flag, searchtype):

    e = encode(img_path).reshape(1,2048)

    if 'Greedy' in searchtype:
        return greedySearch(e, preprocess_flag)

    elif 'k=3' in searchtype:
        return 'Invalid',[]
        #return beam_search_predictions(e, preprocess_flag, beam_index=3)
    elif 'k=5' in searchtype:
        return 'Invalid',[]
    elif 'k=7' in searchtype:
        return 'Invalid',[]
